void snn_inference(fixed_t input[NUM_INPUTS], int &output_class) {
    // Estados dos neurônios
    fixed_mem1_t mem1[NUM_HIDDEN] = {0};
    fixed_mem2_t mem2[NUM_OUTPUTS] = {0};
    ac_int<1, false> spk1[NUM_HIDDEN] = {0};
    ac_int<1, false> spk2[NUM_OUTPUTS] = {0};

    // Parâmetros quantizados
    const fixed_t beta = fixed_t(15) / fixed_t(16); // beta_q / scale_factor
    const fixed_t threshold = fixed_t(1.0); // Ajuste se necessário

    // Loop temporal
    for (int t = 0; t < NUM_STEPS; t++) {

        // Camada 1
        for (int i = 0; i < NUM_HIDDEN; i++) {
            fixed_mem1_t I1 = 0;
            for (int j = 0; j < NUM_INPUTS; j++) {
                weight_fc1_t weight = fc1_weight[i][j];
                if (weight != 0) {
                    fixed_t prod = input[j] * weight.to_int();
                    I1 += prod;
                }
            }
            // Atualização do potencial de membrana
            mem1[i] = beta * mem1[i] + I1;
            // Disparo se exceder o limiar
            if (mem1[i] >= threshold) {
                mem1[i] = 0; // Reset do potencial
                spk1[i] = 1;
            } else {
                spk1[i] = 0;
            }
        }

        // Camada 2
        for (int i = 0; i < NUM_OUTPUTS; i++) {
            fixed_mem2_t I2 = 0;
            for (int j = 0; j < NUM_HIDDEN; j++) {
                weight_fc2_t weight = fc2_weight[i][j];
                if (weight != 0 && spk1[j] == 1) {
                    I2 += weight.to_int();
                }
            }
            mem2[i] = beta * mem2[i] + I2;
            if (mem2[i] >= threshold) {
                mem2[i] = 0;
                spk2[i] = 1;
            } else {
                spk2[i] = 0;
            }
        }
    }

    // Determinar a classe com base nos potenciais finais ou nos spikes acumulados
    int max_index = 0;
    fixed_mem2_t max_value = mem2[0];
    for (int i = 1; i < NUM_OUTPUTS; i++) {
        if (mem2[i] > max_value) {
            max_value = mem2[i];
            max_index = i;
        }
    }

    output_class = max_index;
}

void top_level(fixed_t input[NUM_INPUTS], int &output_class) {
    snn_inference(input, output_class);
}

